import {INPUT_1_DATA, INPUT_2_DATA, INPUT_3_DATA, INPUT_4_DATA, INPUT_5_DATA} from "../types"

const hendlerOnChangeInput_1 = (data)=>{
    
    return {
        type: INPUT_1_DATA,
        payload: data
    }
}

const hendlerOnChangeInput_2 = (data)=>{
    
    return {
        type: INPUT_2_DATA,
        payload: data
    }
}
const hendlerOnChangeInput_3 = (data)=>{
    
    return {
        type: INPUT_3_DATA,
        payload: data
    }
}
const hendlerOnChangeInput_4 = (data)=>{
    
    return {
        type: INPUT_4_DATA,
        payload: data
    }
}
const hendlerOnChangeInput_5 = (data)=>{
    
    return {
        type: INPUT_5_DATA,
        payload: data
    }
}

export {hendlerOnChangeInput_1, hendlerOnChangeInput_2, hendlerOnChangeInput_3, hendlerOnChangeInput_4, hendlerOnChangeInput_5}
